import FriendListItem from '../FriendListItem';

const FriendList = ({ friends }) => {
  return (
    <ul className="friend-list">
      {friends.map(el => (
        <FriendListItem avatar={el.avatar} name={el.name} avatar={el.avatar} />
      ))}
    </ul>
  );
};

export default FriendList;
